import './App.css';
const contact = [
  { name: "LI Ka Kin Keith", mobile: "68958166", email: "keithli026@gmail.com" }
];

const workExperience = [
  { 
    position: "Frontend web developer", 
    company: "Pantarei Designed Limited", 
    year: "Aug 2021 - present",
    description: {
      d1: "Assisted system design, performed implementation, development, testing and problem diagnosis of web-based application",
      d2: "Enhanced system development and provided on-going maintenance support",
      d3: "Proposed workable ideas and approaches to solve business and technical problems",
      d4: "Worked with project team for project launch and deployment"
    }
  },
  {
    position: "E-commerce Assistant", 
    company: "Hap Hoi Leung Technology (Shenzhen) Co., LTD, Shenzhen", 
    year: "May 2019 - Mar 2020",
    description: {
      d1: "Optimized titles and content of products to increase exposure",
      d2: "Analyzed market trends and post-launch data on weekly basis",
      d3: "Executed marketing and promotional strategies on Taobao and Amazon",
      d4: "Monitored stock level and arranged stock replenishment",
      d5: "Communicated with manufacturers and distributors to ensure smooth logistic"
    }
  },
  {
    position: "Operations Assistant", 
    company: "HK Kong Wai Trading Co., Hong Kong", 
    year: "Oct 2014 - Sep 2017",
    description: {
      d1: "Provided administrative support and performed general merchandising duties",
      d2: "Followed up on purchase orders with customers and vendors and handled inquiries",
      d3: "Facilitated client invoicing and collected payments in company financial system",
      d4: "Assisted in product design and quality control as assigned by manager",
      d5: "Ensured all service work and records are up to date and documented"
    }
  },
];

const education = [
  { year: "2011 - 2014", university: "City University of Hong Kong", major: "BEng (Hons) in Information Engineering" }
];

const skill = [
  { progamming: "C, Java, HTML5, CSS3, JavaScript, jQuery, SQL, PHP", framework: "React, Angular, Ionic 5, Drupal 9, Bootstrap 5, Gitlab" }
];

const language = "Native in Cantonese, Good in English and Mandarin";

const fruits = ["apple", "orange", "banana", "pear", "laichi", "strawberry"];
const [a, b, c, ...other] = fruits;
// equivalent to
// const a = fruits[0];
// const b = fruits[1];
// const c = fruits[2];

const employees = [
  { id: 1, name: 'Alice', country: 'Austria' },
  { id: 2, name: 'Bob', country: 'Belgium' },
  { id: 3, name: 'Carl', country: 'Canada' },
  { id: 4, name: 'Dean', country: 'Denmark' },
  { id: 5, name: 'Ethan', country: 'Egypt' },
];
const employeesReversed = employees.slice().reverse();

function Fruit() {
  return (
    <>
      {fruits.map(el => {
        return (
          <div key={el.toString()} >{el}</div>
        );
      })}
    </>

  );

}

function Profile(props) {
  return (
    <div>
      <h2>name: {props.employee.name}</h2>
      <h2>country: {props.employee.country}</h2>
      <hr />
    </div>
  );
}

function Employee() {
  const results = [];
  for (const el of employeesReversed) {
    results.push(
      <Profile employee={el} key={el.id} />
    );
  }
  return (
    <div className="hi">
      {results}
    </div>
  );
}

function Employee1() {
  return (
    <>
      {employees.map(element => {
        return (
          <Profile employee={element} key={element.id} />
        );
      })}
    </>
  );
}

function Header() {
  const contactInfo = contact.map(item => {
    return (
      <div className="contacts" key={item.mobile}>
        <h1>{item.name}</h1>
        <div>
          <p>{item.mobile}</p>
          <p>{item.email}</p>
        </div>
      </div>
    );
  })
  return (
    <>
      {contactInfo}
    </>
  );
}

function MainContent() {

}
function App() {
  return (
    <>
      <Header />
      <Employee1 />
      <Fruit />
      <Employee />
    </>
  );
}

export default App;
